import './Home.css';
import React from 'react';
// import queryString from 'query-string'

const Home = () => {
   return (
      <div className="home">
         <div className="users">
            <div className="user">gulzer</div>
            <div className="user">saadman</div>
            <div className="user">salman</div>
         </div>

         <div className="chats">
            <div className="log">
               <div className="own-messages">Hey there</div>
               <div className="others-messages">Hi</div>
            </div>
            <input />
         </div>
      </div>
   );
};

export default Home;
